import React from "react";
import SideBarItem from "./sideBarItem";
import { default as Logo1 } from "../assets/WhiteLogo.png";
import { default as Logo2 } from "../assets/BlackLogo.jpg";
import ChangingLogo from "./changingLogo";

const divStyle = {
	width: "50vw",
	height: "100vh",
	position: "fixed",
	zIndex: "100",
	left: "0px",
	top: "0px",
	backgroundColor: "rgba(0,0,0,0)"
};
const logoStyle = {
	height: "155px",
	width: "155px",
	backgroundColor: "white"
};

export default function SideBar(props) {
	return (
		<div id="sideBar" style={divStyle}>
			<ChangingLogo logo1={Logo1} logo2={Logo2} />
			{props.sections.forEach(section => {
				return <SideBarItem title={section} />;
			})}
		</div>
	);
}
